/**
 * @param {string} s
 * @param {string} a
 * @param {string} b
 * @param {number} k
 * @return {number[]}
 */
var beautifulIndices = function(s, a, b, k) {
    const indicesA = [];
    const indicesB = [];
    const result = [];

    // Find all occurrences of a
    for (let i = 0; i <= s.length - a.length; i++) {
        if (s.substring(i, i + a.length) === a) {
            indicesA.push(i);
        }
    }

    // Find all occurrences of b
    for (let i = 0; i <= s.length - b.length; i++) {
        if (s.substring(i, i + b.length) === b) {
            indicesB.push(i);
        }
    }

    // Check for beautiful indices
    indicesA.forEach(i => {
        for (let j = 0; j < indicesB.length; j++) {
            if (Math.abs(i - indicesB[j]) <= k) {
                result.push(i);
                break; // Found a matching b, no need to check further
            }
        }
    });

    return result.sort((a, b) => a - b);
};
